),('Service and RESTful API','de','messages','Services und RESTful API','2015-03-20 20:19:18','2015-03-20 20:19:19'),('Show machines','de','messages','Zeige Computer','2015-03-25 09:56:59','2015-03-25 09:57:00'),('Show Profile','de','messages','Mein Profil','2015-03-25 09:55:32','2015-03-25 09:55:33'),('Show user information','de','messages','Zeige User Informationen','2015-03-25 09:56:38','2015-03-25 09:56:39'),('Sign in','de','messages','Einloggen','2015-03-19 20:22:58','2015-03-19 20:22:58'),('Sign up','de','messages','Registrieren','2015-03-19 20:22:58','2015-03-19 20:22:58'),('Statistics','de','messages','Statistiken','2015-03-19 20:22:58','2015-03-19 20:22:58'),('Statistics mainpage','de','messages','Startseite der Statistiken','2015-03-25 09:53:27','2015-03-25 09:53:27'),('Support','de','messages','Hilfe','2015-03-19 20:22:58','2015-03-19 20:22:58'),('The counter exists since 1993 (originally on counter.li.org) and it is the most official and popular counter of linux users and linux machines in the www. Learn here what our intention is, how it works and how it measures the statistics.','de','messages','Der Linux Counter existiert bereits seit 1993 (original auf counter.li.org) und er ist der offiziellste und populärste Linux Counter im World Wide Web. Lerne hier was uns antreibt, wie der Counter funktioniert und wie wir unsere Statistiken erstellen.','2015-03-20 20:31:20','2015-03-20 20:31:20'),('The New Linux Counter Project','de','messages','The New Linux Counter Project','2015-03-20 20:28:52','2015-03-20 20:28:53'),('This also includes statistics about users per country or city, most used cpus, top uptimes lists and much more.','de','messages','Das beinhaltet auch Statistiken über die Benutzer pro Land oder Stadt, meist benutzte CPUs, Uptime Charts und Vieles mehr.','2015-03-19 20:22:58','2015-03-19 20:22:58'),('This is measured by the access logs of many great websites, together with our statistics and the statistical numbers of <a href=\"http://www.worldometers.info/\">worldometers.info</a>.','de','messages','Sie wird vorgenommen anhand Zugriffslogs vieler großer Webseiten, zusammen mit unser Statistik und den statistischen Zahlen von <a href=\"http://www.worldometers.info/\">worldometers.info</a>.','2015-03-20 20:18:11','2015-03-20 20:18:11'),('Uptime statistics','de','messages','Uptime Statistiken','2015-03-25 09:55:04','2015-03-25 09:55:04'),('User statistics','de','messages','User Statistiken','2015-03-25 09:53:47','2015-03-25 09:53:47'),('Username or Email','de','messages','Username oder Email-Adresse','2015-03-25 09:58:43','2015-03-25 09:58:43'),('View details','de','messages','Zeige Details','2015-03-19 20:22:58','2015-03-19 20:22:58'),('We are providing the most accurate and complete statistics about linux and its distributions, users, kernels and machines in the world wide web.','de','messages','Wir bieten die genauesten und vollständigsten Statistiken rund um Linux und dessen Distributionen, Benutzer, Kernel und Computer im World Wide Web.','2015-03-19 20:22:58','2015-03-19 20:22:58'),('You own a linux box or an android smartphone? You are the administrator of a big server farm? You have some raspberry pis at home or an old laptop with linux on it? Get counted as a linux user and register your linux machines now!','de','messages','Du nennst einen Linux Computer oder ein Android Smartphone Dein Eigen? Du bist ein Administrator einer großen Server Farm? Du hast einen oder mehrere Raspberry Pis Zuhause oder einen alten Laptop mit Linux? Registriere Dich hier als Linux Benutzer und vervollständige so unsere Statistiken!','2015-03-20 20:25:00','2015-03-20 20:25:00');
